import React from 'react'
import img1 from "../assets/1.jpg"

const Home = () => {
  return (
    <div className="w-full">
      <div>
        <img src={img1} className='h-90 w-full'/>
      </div>



    <div className='h-[1000px]'></div>

    </div>
  )
}

export default Home
